css:
.editor {
  background-color: #000000;
  color: #ffffff;
}
.editor .gutter {
  background-color: #000000;
  color: #ffffff;
}
.editor .gutter .line-number.cursor-line {
  background-color: rgba(0, 0, 0, 0.07);
  color: #ffffff;
}
.editor .gutter .line-number.cursor-line-no-selection {
  color: #ffffff;
}
.editor .wrap-guide {
  color: #bfbfbf;
}
.editor .indent-guide {
  color: #bfbfbf;
}
.editor .invisible-character {
  color: #bfbfbf;
}
.editor .search-results .marker .region {
  background-color: transparent;
  border: #bfbfbf;
}
.editor .search-results .marker.current-result .region {
  border: #ffffff;
}
.editor.is-focused .cursor {
  border-color: #ffffff;
}
.editor.is-focused .selection .region {
  background-color: #bad6fd;
}
.editor.is-focused .line-number.cursor-line-no-selection,
.editor.is-focused .line.cursor-line {
  background-color: rgba(0, 0, 0, 0.07);
}
.comment {
  color: #919191;
}
.string {
  color: #00A33F;
}
.constant.language {
  color: #A535AE;
}
.keyword {
  color: #FF5600;
}
.storage {
  color: #FF5600;
}
.entity.name.type {
  color: #00ffff;
}
.entity.name.function {
  color: #00ffff;
}
.support.function {
  color: #A535AE;
}
.support.constant {
  color: #A535AE;
}
.support.type,
.support.class {
  color: #A535AE;
}
.support.variable {
  color: #A535AE;
}
.invalid {
  color: #FFFFFF;
  background-color: #990000;
}
.constant.other.placeholder.py {
  color: #990000;
}
